import React from 'react';
import '../styles/Terms.css';

const Terms = () => {
  return (
    <div className="terms-container">
      <h2>Terms and Conditions</h2>
      <p>Welcome to our car rescue service. By using our service, you agree to the following terms and conditions:</p>
      <ul>
        <li>We provide car recovery services for vehicles that are in need of assistance.</li>
        <li>All bookings are subject to availability of our flatbed trucks and drivers.</li>
        <li>The cost of services will be negotiated on-site and confirmed before any work begins.</li>
        <li>Payment must be made before or after service, depending on mutual agreement.</li>
        <li>We are not liable for any damages that may occur during the rescue process.</li>
        <li>By using this service, you accept these terms in full.</li>
      </ul>
    </div>
  );
};

export default Terms;
